import './App.css';
import * as React from 'react';
import {Select,TextField, InputLabel,MenuItem,FormControl,Radio,RadioGroup,Button,FormControlLabel,FormLabel} from '@mui/material';
import Checkbox from '@mui/material/Checkbox';


class App extends React.Component{
  constructor(props){
    super(props);

    this.state ={
      user:{
        Firstname:"",
        Lastname:"",
        Gender:"",
        Country:"",
        State:"",
        Phonenumber:"",
        EmailId:""

      }
    }
  }

  handleClick(event){
    console.log(this.state.user);
  }

  handleChange = (event) => {
    console.log("this is :", event , event.target.name , event.target.value);

    this.setState((state)=>({
      ...state,

      user:{
        ...state.user,
        [event.target.name]: event.target.value
      }
    }),
    ()=>console.log(this.state)
    )
  }


  render() {
    return (

      <div>

        <div className='body'>
              <img src={require('../src/img.jpeg')}/>
        </div>

        <div className='body'>
          <TextField name='Firstname' onChange={(event)=> this.handleChange(event)} sx={{ m: 1, minWidth: 400 }} placeholder='First name' />
        </div>

        <div className='body'>
          <TextField name='Lastname' onChange={(event)=> this.handleChange(event)}  sx={{ m: 1, minWidth: 400 }}  className='Textfield'  placeholder='Last name' />
        </div>

        <div className='body'>

          <FormLabel className='body' >Gender</FormLabel>
            <RadioGroup name='Gender' onChange={(event)=> this.handleChange(event)} row>
              <FormControlLabel value="female" control={<Radio />} label="Female" />
              <FormControlLabel value="male" control={<Radio />} label="Male" />
              <FormControlLabel value="other" control={<Radio />} label="Other" />
            </RadioGroup>

        </div>

        <div className='body'>
          <FormControl sx={{ m: 1, minWidth: 400 }} >
            <InputLabel >Country</InputLabel>
              <Select name='Country' onChange={(event)=> this.handleChange(event)}>
                <MenuItem  value={'India'}>India</MenuItem>
                <MenuItem value={'Afganistan'} >Afganistan</MenuItem>
                <MenuItem value={'Australia'}>Australia</MenuItem>
                <MenuItem value={'Bangladesh'}>Bangladesh</MenuItem>
                <MenuItem value={'Brazil'}>Brazil</MenuItem>
                <MenuItem value={'China'}>China</MenuItem>
                <MenuItem value={'France'}>France</MenuItem>
                <MenuItem value={'Italy'}>Italy</MenuItem>
              </Select>
          </FormControl>
        </div>

        <div className='body'>
          <TextField name='State' onChange={(event)=> this.handleChange(event)} sx={{ m: 1, minWidth: 400 }} className='Textfield'  placeholder='State' />
        </div>

        <div className='body'>
          <TextField name='Phonenumber' onChange={(event)=> this.handleChange(event)} sx={{ m: 1, minWidth: 400 }}  className='Textfield'  placeholder='Phone Number' />
        </div>

        <div className='body'>
          <TextField name='EmailId' onChange={(event)=> this.handleChange(event)} sx={{ m: 1, minWidth: 400 }} className='Textfield'  placeholder='Email Address' />
        </div>

        <div>
        <Checkbox {...label} defaultChecked />

        </div>


        <div className='body'>
          <Button onClick={(event)=>this.handleClick(event)} sx={{ m: 1, minWidth: 400 }}  variant="contained">Submit </Button>
        </div>


{JSON.stringify(this.state.user.Firstname)}<br/>
{JSON.stringify(this.state.user.Lastname)}<br/>
{JSON.stringify(this.state.user.Gender)}<br/>
{JSON.stringify(this.state.user.Country)}<br/>
{JSON.stringify(this.state.user.State)}<br/>
{JSON.stringify(this.state.user.Phonenumber)}<br/>
{JSON.stringify(this.state.user.EmailId)}<br/>



    </div>

    );
  }
}

export default App;
